pragma solidity ^0.5.9;
pragma experimental ABIEncoderV2;


contract HelloWorld {



  string public yourName ;



    struct UserDetail {
        address addr;
        string name;
        string password;
        string CNIC;
        bool isUserLoggedIn;
    }


    struct UserAddressName {
        address message;
        string sender;
        string receiver;

    }

    string [] public  meeasgeList;
    string [] public  senderList;

    UserAddressName [] public registeredArray; // added the array
    mapping(address => UserDetail) user;


    event Message(string   message , string sender);


    constructor() public {
        yourName = "Unknowfn" ;
        }

    function getmeeasgeList() public view returns (string[] memory) {
        return meeasgeList;
    }
    function getsenderList() public view returns (string[] memory) {
        return senderList;
    }
    function pushTomeeasgeList(string memory newValue ,string memory   sender,string memory   receiver) public {

        meeasgeList.push(newValue );
//        senderList.push(sender );

        emit Message(newValue,sender);
    }

    function setName(string memory nm) public{
        yourName = nm ;
    }
    // user registration function
    function register(
        address _address,
        string memory _name,
        string memory _password

    ) public returns (bool) {
//        require(user[_address].addr != msg.sender);
        user[_address].addr = _address;
        user[_address].name = _name;
        user[_address].password = _password;
        user[_address].isUserLoggedIn = false;

//        UserAddressName memory myStruct = ;
     //   registeredArray.push(UserAddressName(_address,_name));

        return true;
    }

    // user login function
    function login(address _address, string memory _password)
    public
    returns (bool)
    {
        if (
            keccak256(abi.encodePacked(user[_address].password)) ==
            keccak256(abi.encodePacked(_password))
        ) {
            user[_address].isUserLoggedIn = true;
            return user[_address].isUserLoggedIn;
        } else {
            return false;
        }
    }

    // check the user logged In or not
    function checkIsUserLogged(address _address) public view returns (bool) {
        return (user[_address].isUserLoggedIn);
    }

    // logout the user
    function logout(address _address) public {
        user[_address].isUserLoggedIn = false;
    }

    function getUserList() public view returns (UserAddressName[] memory) {
        return registeredArray;
    }
}
